import { Outlet, Navigate } from "react-router-dom";

const privateRoutes = () => {
    const isAuth = localStorage.getItem('isAuth')
    if (!isAuth){
        return <Navigate to='/login'/>
    }
    return <Outlet/>

}

export default privateRoutes
